  return (
    <div>
      <Header />
      <h2>Restaurants</h2>
      <nav>
        <NavLink activeClassName="active-link" className="restaurant-li" to='/AllRestaurants'>All</NavLink>
        <NavLink activeClassName="active-link" className="restaurant-li" to='/New'>New</NavLink>
        <NavLink activeClassName="active-link" className="restaurant-li" to='/MostPopular'>Most Popular</NavLink>
        <NavLink activeClassName="active-link" className="restaurant-li" to='/OpenNow'>Open Now</NavLink>
      </nav>
      <div className="restaurants-grid">
        {arr.map((prop) => {<BeigeCard
          title={prop.restaurantName}
          detail={prop.chefName}
          img={prop.restaurantImage}
        ></BeigeCard>})}
      </div>
    </div>
  );
};

